INSERT INTO `travels` VALUES (6,'Поездка на Байкал','День 1. Перелёт и первое \"Здравствуй, Байкал!\"\nУтренний рейс Москва–Иркутск. За иллюминатором — бескрайние сибирские просторы, тайга, как зелёное море. В аэропорту встречает резкий свежий ветер — уже пахнет озером.\n\nНа маршрутке до Листвянки дорога петляет между холмов, и вот он — первый взгляд на Байкал! Синева, от которой перехватывает дыхание. Вечером — набережная, копчёный омуль с дымком и тёплые позы в крошечной кафешке.\n\nДень 2. Вода, камни и тишина\nПаром на остров Ольхон. Два часа сквозь волны, солёные брызги на губах. Хужин встречает запахом полыни и горячего песка.\n\nЯ иду к Шаман-скале, трогаю разноцветные ленточки на ветру. Местный пёс провожает меня до пляжа, где вода такая прозрачная, что видно каждый камешек. Вечером ночую в деревянном гостевом домике — сквозь окно светит Млечный Путь.\n\nДень 3. Обратная дорога с кусочком Байкала в рюкзаке\nУтро начинаю с чая с байкальскими травами. В рюкзак кладу:\n• плоский камешек с мыса Хобой,\n• фотографию заката над скалами,\n• и странное чувство — будто часть меня останется здесь, у этой древней воды.\n\nВ самолёте, уже над Уралом, закрываю глаза — и снова слышу плеск волн у берега.\n\nP.S. Самое дорогое, что привёз: привычку останавливаться и просто смотреть на воду. Теперь даже Москва-река кажется глубже.\n\n(Маршрут реальный: можно уложить в 3-4 дня, если взять выходные. Главное — не пытаться объять необъятное, а дать Байкалу себя поразить.)',32,'[\"data:image/jpeg;base64,\", \"data:image/jpeg;base64,\", \"data:image/jpeg;base64,\"]',34000.00,10,10,9,10,'2025-07-20 10:19:39','Alexandr'),(7,'Из России в Японию','День 1. Перелёт: из сибирской зимы в японскую весну\nУтренний вылет из Владивостока — всего 2,5 часа, и вот уже самолет касается посадочной полосы аэропорта Токио-Ханеда. За иллюминатором вместо заснеженных просторов — аккуратные рисовые поля и город, сверкающий, как голограмма. Первое потрясение — тёплый влажный воздух, пахнущий морем и цветущей сливой.\n\nДень 2. Токио: город-лабиринт\nУтро начинается с чашки маття в крошечном кафе в Асакусе. Рядом древний храм Сэнсодзи, где я тяну бумажное предсказание омикудзи — и оно оказывается счастливым! Дальше — блуждание среди неоновых улиц Сибуя, обед из раменного автомата (да, это вкуснее, чем кажется) и внезапная встреча с аистом в парке Уэно. Вечером — вид на город с 45 этажа Mori Tower, где огни мегаполиса мерцают, как стая светлячков.\n\nДень 3. Киото: путешествие во времени\nСинкансэн за 2 часа переносит меня в другую эпоху. В Киото идёт лёгкий дождь, отчего пагоды и мосты выглядят как старинная гравюра. В бамбуковом лесу Арасияма шепчутся листья, а в чайном домике у подножия гор пожилая хозяйка учит меня правильно взбивать маття — её руки двигаются с грацией танцовщицы.\n\nДень 4. Возвращение: чемодан с чудесами\nВ рюкзаке:\n\nзасушенный лепесток сакуры из храмового сада,\n\nстранная конфета со вкусом «снега Хоккайдо»,\n\nи осознание, что «ваби-саби» — это не философия, а состояние души, когда понимаешь: даже билет на обратный рейс — часть приключения.\n\nP.S. В аэропорту Нарита долго смотрю на последний японский закат — розовый, как лосось в суши-баре. И знаю, что это не прощание, а «джа ней» — «до встречи».',42,'[\"data:image/jpeg;base64,\", \"data:image/jpeg;base64,\", \"data:image/jpeg;base64,\"]',110000.00,8,10,10,9,'2025-07-20 10:26:05','Sem');
